var data = require('./data.json');
console.log(data)
const SavingAcc = () => {
    return (
        <div>
            <h2>Savings Account</h2>
            {methods.map((p, key) => {
       return (
           <tr>
           <td>{key}</td>
           <td>{p.name}</td>
           {p.pagesName.map((n, key) => {
           return (
              <>
              <td>{n.name}</td>
              <td>{n.message}</td>
              <td>{n.messageType}</td>
              </>
            )
            })}
           </tr>
           )})
           }
        </div>
    )
}
export default SavingAcc;
